
namespace RasterImageAsSvg
{


    public class ImageEmbedding
    {


        public static string GetMimeType(System.Guid formatUID)
        {
            System.Drawing.Imaging.ImageCodecInfo[] codecs = System.Drawing.Imaging.ImageCodecInfo.GetImageDecoders();

            foreach (System.Drawing.Imaging.ImageCodecInfo codec in codecs)
            {
                if (codec.FormatID == formatUID)
                    return codec.MimeType;
            } // Next codec 

            return "image/unknown";
        } // End Function GetMimeType 


        public static void EncodeImage(string file)
        {
            string path = System.IO.Path.GetDirectoryName(file);
            string outFile = System.IO.Path.GetFileNameWithoutExtension(file) + ".svg";
            outFile = System.IO.Path.Combine(path, outFile);

            EncodeImage(file, outFile);
        } // End Sub EncodeImage 


        public static void EncodeImage(string file, string outFile)
        {
            byte[] imageData;
            string width = "";
            string height = "";
            string mimeType = "";

            using (System.Drawing.Image img = System.Drawing.Image.FromFile(file))
            {
                mimeType = GetMimeType(img.RawFormat.Guid);
                width = img.Width.ToString(System.Globalization.CultureInfo.InvariantCulture);
                height = img.Height.ToString(System.Globalization.CultureInfo.InvariantCulture);

                using (System.IO.MemoryStream ms = new System.IO.MemoryStream())
                {
                    // img.Save(ms, img.RawFormat);
                    img.Save(ms, System.Drawing.Imaging.ImageFormat.Png);
                    mimeType = GetMimeType(System.Drawing.Imaging.ImageFormat.Png.Guid);
                    imageData = ms.ToArray();
                } // End Using ms 

            } // End Using img 


            string base64 = System.Convert.ToBase64String(imageData); ;

            string skeleton = $@"
<svg xmlns=""http://www.w3.org/2000/svg"" xmlns:svg=""http://www.w3.org/2000/svg"" xmlns:xlink=""http://www.w3.org/1999/xlink""
   version=""1.1"" viewBox=""0 0 {width} {height}""
   width=""{width}"" height=""{height}"" >
    <image x=""0"" y=""0"" width=""{width}"" height=""{height}"" preserveAspectRatio=""xMidYMid meet""
       xlink:href=""data:{mimeType};base64,{base64}"" />
</svg>
";

            System.IO.File.WriteAllText(outFile, skeleton, System.Text.Encoding.UTF8);
        } // End Sub EncodeImage 


        public static void CompareStrings(string fileWorks, string fileNotWorks)
        {
            System.Console.WriteLine("comparing");

            int diffCount = 0;

            for (int i = 0; i < fileWorks.Length; ++i)
            {
                if (fileWorks[i] != fileNotWorks[i])
                {
                    System.Console.WriteLine("heureka: {0}", i);
                    diffCount++;
                }

            } // Next i 

            System.Console.WriteLine($"Finished comparing strings. diffCount: {diffCount}");
        } // End Sub CompareStrings 


        public static void BeautifyXml(string inFile)
        {
            string fileName = System.IO.Path.GetFileNameWithoutExtension(inFile);
            string outDir = System.IO.Path.GetDirectoryName(inFile);
            string outFile = System.IO.Path.Combine(outDir, fileName + "_beautified.svg");

            BeautifyXml(inFile, outFile);
        } // End Sub BeautifyXml 


        public static void BeautifyXml(string inFile, string outFile)
        {
            System.Xml.XmlDocument doc = new System.Xml.XmlDocument();
            doc.XmlResolver = null;
            doc.Load(inFile);

            System.Xml.XmlWriterSettings settings = new System.Xml.XmlWriterSettings
            {
                Indent = true,
                IndentChars = "  ",
                NewLineChars = "\r\n",
                NewLineHandling = System.Xml.NewLineHandling.Replace
            };

            using (System.Xml.XmlWriter writer = System.Xml.XmlWriter.Create(outFile, settings))
            {
                doc.Save(writer);
            } // End Using writer 

        } // End Sub BeautifyXml 




